import React from 'react';
import { Link } from 'react-router-dom';


function Signup() {
  return (
    <div className="flex flex-col min-h-screen overflow-hidden">

    <div className="flex justify-center py-8 items-center text-center">
      <a href='/' className="flex title-font  items-center text-cyan-500 mb-4 md:mb-0">
        <img src="https://th.bing.com/th/id/R.43cbe371eab620cc34f430f23b59ae38?rik=msO6LwhDtZ7Z%2bA&pid=ImgRaw&r=0" alt="icon" className="w-16 ml-4"/>
        <span className="ml-3 text-5xl font-extrabold text-black font-serif">Covoit'<span className="text-cyan-500 font-light italic">ici</span></span>
      </a>
      </div>

      {/*  Page content */}
      <main className="flex-grow">

        <section className="bg-white">
          <div className="max-w-6xl mx-auto px-4 sm:px-6">
            <div className="pt-8 pb-8 md:pt-4 md:pb-15">

              {/* Page header */}
              <div className="max-w-3xl mx-auto pb-12 text-center  ">
                <h1 className="text-5xl font-black  text-black  ">Become a driver and help people  </h1>
              </div>
              {/* Form */}
              <div className="max-w-4xl mx-auto">
                <form className='grid grid-cols-3 gap-6' action='' method=''>
                <div class="relative z-0  mb-6  w-full group">
                        <input type="text" name="name" class="block py-2.5 w-full text-lg font-semibold  text-gray-900 bg-transparent border-0 border-b-2 border-gray-300 appearance-none dark:text-white dark:border-gray-600 dark:focus:border-cyan-500 focus:outline-none focus:ring-0 focus:border-cyan-600 peer" placeholder=" " required />
                        <label for="name" class="absolute text-lg font-semibold  text-gray-500 dark:text-gray-400 duration-300 transform -translate-y-6 scale-75 top-3 -z-10 origin-[0] peer-focus:left-0 peer-focus:text-cyan-600 peer-focus:dark:text-cyan-500 peer-placeholder-shown:scale-100 peer-placeholder-shown:translate-y-0 peer-focus:scale-75 peer-focus:-translate-y-6">First Name</label>
                    </div>
                <div class="relative z-0  mb-6  w-full group">
                        <input type="text" name="name" class="block py-2.5 w-full text-lg font-semibold  text-gray-900 bg-transparent border-0 border-b-2 border-gray-300 appearance-none dark:text-white dark:border-gray-600 dark:focus:border-cyan-500 focus:outline-none focus:ring-0 focus:border-cyan-600 peer" placeholder=" " required />
                        <label for="name" class="absolute text-lg font-semibold  text-gray-500 dark:text-gray-400 duration-300 transform -translate-y-6 scale-75 top-3 -z-10 origin-[0] peer-focus:left-0 peer-focus:text-cyan-600 peer-focus:dark:text-cyan-500 peer-placeholder-shown:scale-100 peer-placeholder-shown:translate-y-0 peer-focus:scale-75 peer-focus:-translate-y-6">Last Name</label>
                    </div>
                    <br />
                <div class="relative z-0  mb-6  w-full group">
                        <input type="number" name="Age" class="block py-2.5 w-full text-lg font-semibold  text-gray-900 bg-transparent border-0 border-b-2 border-gray-300 appearance-none dark:text-white dark:border-gray-600 dark:focus:border-cyan-500 focus:outline-none focus:ring-0 focus:border-cyan-600 peer" placeholder=" " required />
                        <label for="Age" class="absolute text-lg font-semibold  text-gray-500 dark:text-gray-400 duration-300 transform -translate-y-6 scale-75 top-3 -z-10 origin-[0] peer-focus:left-0 peer-focus:text-cyan-600 peer-focus:dark:text-cyan-500 peer-placeholder-shown:scale-100 peer-placeholder-shown:translate-y-0 peer-focus:scale-75 peer-focus:-translate-y-6">Age</label>
                    </div>
                <div class="relative z-0  mb-6  w-full group">
                <label for="name" class="absolute text-lg font-semibold  text-gray-500 dark:text-gray-400 duration-300 transform -translate-y-6 scale-75 top-3 -z-10 origin-[0] peer-focus:left-0 peer-focus:text-cyan-600 peer-focus:dark:text-cyan-500 peer-placeholder-shown:scale-100 peer-placeholder-shown:translate-y-0 peer-focus:scale-75 peer-focus:-translate-y-6">Gender</label>
                <select id="countries" name='depart' class="block py-2.5 w-full text-lg font-semibold  text-gray-900 bg-transparent border-0 border-b-2 border-gray-300 appearance-none dark:text-white dark:border-gray-600 dark:focus:border-cyan-500 focus:outline-none focus:ring-0 focus:border-cyan-600 peer">
                  <option className='p-4'>Male</option>
                  <option className='p-4'>Female</option>
                </select>                        
                    </div>
                <div class="relative z-0  mb-6  w-full group">
                        <input type="email" name="email" class="block py-2.5 w-full text-lg font-semibold  text-gray-900 bg-transparent border-0 border-b-2 border-gray-300 appearance-none dark:text-white dark:border-gray-600 dark:focus:border-cyan-500 focus:outline-none focus:ring-0 focus:border-cyan-600 peer" placeholder=" " required />
                        <label for="email" class="absolute text-lg font-semibold  text-gray-500 dark:text-gray-400 duration-300 transform -translate-y-6 scale-75 top-3 -z-10 origin-[0] peer-focus:left-0 peer-focus:text-cyan-600 peer-focus:dark:text-cyan-500 peer-placeholder-shown:scale-100 peer-placeholder-shown:translate-y-0 peer-focus:scale-75 peer-focus:-translate-y-6">Email address</label>
                    </div>
                    <div class="relative z-0  mb-6 w-full group">
                        <input type="password" name="password" id="floating_password" class="block py-2.5 w-full text-lg font-semibold  text-gray-900 bg-transparent border-0 border-b-2 border-gray-300 appearance-none dark:text-white dark:border-gray-600 dark:focus:border-cyan-500 focus:outline-none focus:ring-0 focus:border-cyan-600 peer" placeholder=" " required />
                        <label for="password" class="absolute text-lg font-semibold  text-gray-500 dark:text-gray-400 duration-300 transform -translate-y-6 scale-75 top-3 -z-10 origin-[0] peer-focus:left-0 peer-focus:text-cyan-600 peer-focus:dark:text-cyan-500 peer-placeholder-shown:scale-100 peer-placeholder-shown:translate-y-0 peer-focus:scale-75 peer-focus:-translate-y-6">Password</label>
                    </div>
                    <br />
                    <button type="submit" class="mt-4 text-white bg-cyan-500 hover:bg-cyan-600 focus:ring-4 focus:outline-none focus:ring-cyan-500 font-semibold rounded-md text-lg w-full sm:w-full px-5 py-2.5 text-center dark:bg-cyan-600 dark:hover:bg-cyan-700 dark:focus:ring-cyan-800">Join Now</button>
                </form>

              </div>

            </div>
          </div>
        </section>

      </main>

    </div>
  );
}

export default Signup;



